abstract class z_congestion_control_t {
  /// Messages are not dropped in case of congestion.
  static const int Z_CONGESTION_CONTROL_BLOCK = 0;

  /// Messages are dropped in case of congestion.
  static const int Z_CONGESTION_CONTROL_DROP = 1;

  /// Messages except the first one are dropped in case of congestion.
  static const int Z_CONGESTION_CONTROL_BLOCK_FIRST = 2;
}

/// Consolidation mode values.
abstract class z_consolidation_mode_t {
  /// Let Zenoh decide the best consolidation mode depending on the query selector.
  /// If the selector contains time range properties, consolidation mode `NONE` is used.
  /// Otherwise the `LATEST` consolidation mode is used.
  static const int Z_CONSOLIDATION_MODE_AUTO = -1;

  /// No consolidation is applied. Replies may come in any order and any number.
  static const int Z_CONSOLIDATION_MODE_NONE = 0;

  /// It guarantees that any reply for a given key expression will be monotonic in time
  /// w.r.t. the previous received replies for the same key expression. I.e., for the same key expression multiple
  /// replies may be received. It is guaranteed that two replies received at t1 and t2 will have timestamp
  /// ts2 > ts1. It optimizes latency.
  static const int Z_CONSOLIDATION_MODE_MONOTONIC = 1;

  /// It guarantees unicity of replies for the same key expression.
  /// It optimizes bandwidth.
  static const int Z_CONSOLIDATION_MODE_LATEST = 2;
}

abstract class z_keyexpr_intersection_level_t {
  /// 2 key expressions do not intersect.
  static const int Z_KEYEXPR_INTERSECTION_LEVEL_DISJOINT = 0;

  /// 2 key expressions intersect, i.e. there exists at least one key expression that is included by both.
  static const int Z_KEYEXPR_INTERSECTION_LEVEL_INTERSECTS = 1;

  /// First key expression is the superset of second one.
  static const int Z_KEYEXPR_INTERSECTION_LEVEL_INCLUDES = 2;

  /// 2 key expressions are equal.
  static const int Z_KEYEXPR_INTERSECTION_LEVEL_EQUALS = 3;
}

/// The priority of zenoh messages.
abstract class z_priority_t {
  /// Priority for ``RealTime`` messages.
  static const int Z_PRIORITY_REAL_TIME = 1;

  /// Highest priority for ``Interactive`` messages.
  static const int Z_PRIORITY_INTERACTIVE_HIGH = 2;

  /// Lowest priority for ``Interactive`` messages.
  static const int Z_PRIORITY_INTERACTIVE_LOW = 3;

  /// Highest priority for ``Data`` messages.
  static const int Z_PRIORITY_DATA_HIGH = 4;

  /// Default priority for ``Data`` messages.
  static const int Z_PRIORITY_DATA = 5;

  /// Lowest priority for ``Data`` messages.
  static const int Z_PRIORITY_DATA_LOW = 6;

  /// Priority for ``Background traffic`` messages.
  static const int Z_PRIORITY_BACKGROUND = 7;
}

/// The Queryables that should be target of a `z_get()`.
abstract class z_query_target_t {
  /// The nearest complete queryable if any else all matching queryables.
  static const int Z_QUERY_TARGET_BEST_MATCHING = 0;

  /// All matching queryables.
  static const int Z_QUERY_TARGET_ALL = 1;

  /// All complete queryables.
  static const int Z_QUERY_TARGET_ALL_COMPLETE = 2;
}

abstract class z_reliability_t {
  /// Defines reliability as ``BEST_EFFORT``
  static const int Z_RELIABILITY_BEST_EFFORT = 0;

  /// Defines reliability as ``RELIABLE``
  static const int Z_RELIABILITY_RELIABLE = 1;
}

abstract class z_sample_kind_t {
  /// The Sample was issued by a ``put`` operation.
  static const int Z_SAMPLE_KIND_PUT = 0;

  /// The Sample was issued by a ``delete`` operation.
  static const int Z_SAMPLE_KIND_DELETE = 1;
}

abstract class z_what_t {
  static const int Z_WHAT_ROUTER = 1;
  static const int Z_WHAT_PEER = 2;
  static const int Z_WHAT_CLIENT = 4;
  static const int Z_WHAT_ROUTER_PEER = 3;
  static const int Z_WHAT_ROUTER_CLIENT = 5;
  static const int Z_WHAT_PEER_CLIENT = 6;
  static const int Z_WHAT_ROUTER_PEER_CLIENT = 7;
}

abstract class z_whatami_t {
  static const int Z_WHATAMI_ROUTER = 1;
  static const int Z_WHATAMI_PEER = 2;
