}

/// The locality of samples to be received by subscribers or targeted by publishers.
abstract class zc_locality_t {
  /// Any
  static const int ZC_LOCALITY_ANY = 0;

  /// Only from local sessions.
  static const int ZC_LOCALITY_SESSION_LOCAL = 1;

  /// Only from remote sessions.
  static const int ZC_LOCALITY_REMOTE = 2;
}

/// Severity level of Zenoh log message.
abstract class zc_log_severity_t {
  /// The `trace` level.
  ///
  /// Designates very low priority, often extremely verbose, information.
  static const int ZC_LOG_SEVERITY_TRACE = 0;

  /// The "debug" level.
  ///
  /// Designates lower priority information.
  static const int ZC_LOG_SEVERITY_DEBUG = 1;

  /// The "info" level.
  ///
  /// Designates useful information.
  static const int ZC_LOG_SEVERITY_INFO = 2;

  /// The "warn" level.
  ///
  /// Designates hazardous situations.
  static const int ZC_LOG_SEVERITY_WARN = 3;

  /// The "error" level.
  ///
  /// Designates very serious errors.
  static const int ZC_LOG_SEVERITY_ERROR = 4;
}

abstract class zc_reply_keyexpr_t {
  /// Replies to any key expression queries.
  static const int ZC_REPLY_KEYEXPR_ANY = 0;

  /// Replies only to queries with intersecting key expressions.
  static const int ZC_REPLY_KEYEXPR_MATCHING_QUERY = 1;
}

abstract class ze_advanced_publisher_heartbeat_mode_t {
  /// Disable heartbeat-based last sample miss detection.
  static const int ZE_ADVANCED_PUBLISHER_HEARTBEAT_MODE_NONE = 0;

  /// Allow last sample miss detection through periodic heartbeat.
  /// Periodically send the last published Sample's sequence number to allow last sample recovery.
  static const int ZE_ADVANCED_PUBLISHER_HEARTBEAT_MODE_PERIODIC = 1;

  /// Allow last sample miss detection through sporadic heartbeat.
  /// Each period, the last published Sample's sequence number is sent with `z_congestion_control_t::BLOCK`
  /// but only if it changed since last period.
  static const int ZE_ADVANCED_PUBLISHER_HEARTBEAT_MODE_SPORADIC = 2;
}

